import React, { forwardRef, useImperativeHandle, useState } from 'react';

const Menu = forwardRef((props, ref) => {
	const [Open, setOpen] = useState(false);

	useImperativeHandle(ref, () => {
		return { setOpen: () => setOpen(true) };
	});
	return (
		<>
			{Open && (
				<nav>
					<h1>logo</h1>
				</nav>
			)}
		</>
	);
});

export default Menu;
